import React from "react";
import styled from "styled-components";
import { IoMdArrowRoundForward } from "react-icons/io";

const SloganHeaderBlock = styled.div`
  display: flex;
  text-align: center;
  padding-top: 10px;
  padding-left: 30px;
  padding-right: 10px;
  p {
    display: inline-block;
    font-size: 1.5rem;
    font-weight: bold;
    color: white;
  }
  background: #1c1c1c;
  .Menubar {
    display: inline-block;
    color: white;
    margin-left: 20vw;
    text-align: center;
  }
  span + span {
    margin-left: 1rem;
  }

  .GoCommunity {
    justify-content: center;
    :hover {
      color: gray;
    }
  }
`;

function Slogan_Header() {
  return (
    <SloganHeaderBlock>
      <p>EndLess Creation</p>
      <ul>
        <li>AboutEC</li>
        <li>Activity</li>
        <li>Project</li>
        <li>Member</li>
        <li>Contact</li>
      </ul>
      <div className="Menubar">
        <span>AboutEC</span>
        <span>Activity</span>
        <span>Project</span>
        <span>Member</span>
        <span>Contact</span>
        <span className="GoCommunity">
          Community
          <IoMdArrowRoundForward size="15" />
        </span>
      </div>
    </SloganHeaderBlock>
  );
}

export default Slogan_Header;
